import React from 'react';

const BlogPost = ( prop ) => {
	console.log(prop)

    let post;
    if (prop != undefined) {
        post = prop.title;
    } else {
    	post = null;
    }

	return (

      <div className='blog-post-wrapper'>

      <h1> {post} </h1>

      </div>

	);
}

export default BlogPost;
